//              COMPONENT FOR PROFILE CARD                  //

// Importing Require Module :
import React from 'react';

// Profile Card Component :
function Pro() {

    // Returining the JSX :

    return (
        <>
            <div id="ProfileCard">
                <div id="ProfileImg">
                    <img src="junaid.jpg" alt="ERROR"></img>
                </div>
                <div id="ProfileContent">
                    <strong>NAME : </strong> <span>junaidasdasdasdasd</span> <br/>
                    <strong>PROFESSION : </strong> <span>Software Developer</span>

                </div>
            </div>
        </>
    )

};


export default Pro;
